Ext.data.JsonP['ACS_2013_14_February_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>ACS 2013 14 February Release Note</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n\t\t<div id=\"banner\" class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n\t\t\t<p>You can now find Appcelerator documentation at <a href=\"https://docs.axway.com/\" target=\"_blank\">https://docs.axway.com/</a>. This site will be taken down in the near future.</p></div>\n        <div class=\"header\"/>\n\n        <div id=\"src-50725362\" class=\"content\">\n                        <h1>ACS 2013 14 February Release Note</h1>\n<ul class=\" \"><li class=\" \">    <p>Added new admin operation:    </p>\n<ul class=\" \"><li class=\" \">    <p>Admin Drop Custom Collection allows admin users to drop a Custom Object collection. For details, see <a class=\"external-link external-link\" href=\"#!/guide/file:///C:/AppC_Work_area/releasenotes-section-!/guide/admin_access\">Admin Access</a>.    </p>\n</li></ul></li><li class=\" \">    <p>Added support for atomic increment operator, $inc. For details see <a class=\"external-link external-link\" href=\"#!/guide/file:///C:/AppC_Work_area/releasenotes-section-!/guide/atomic_increment\">Atomic Increment Operation</a>.    </p>\n</li><li class=\" \">    <p>Fixed ACS website issues:    </p>\n<ul class=\" \"><li class=\" \">    <p>Places could not be added manually from the website    </p>\n</li><li class=\" \">    <p>Longitude and latitude fields were limited to 4 characters    </p>\n</li><li class=\" \">    <p>Custom field boolean could be interpreted as a string    </p>\n</li></ul></li></ul>        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=50725362\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"ACS 2013 14 February Release Note"});